import { directive } from '@babel/types';

const Movie = () => {
    <div className="video-container">
        <video className="video-player" autoplay controlslist="nodownload" crossorigin="anonymous" loop playsinline preload="metadata" style="object-fit: cover;"><source id="mp4" src="https://a0.muscache.com/v/c8/44/c84447fb-f877-54ba-8ab4-96c5823da807/c84447fbf87754ba8ab496c5823da807_1000k_1.mp4?imformat=h265" type="video/mp4; codecs=hevc" /><source id="mp4" src="https://a0.muscache.com/v/c8/44/c84447fb-f877-54ba-8ab4-96c5823da807/c84447fbf87754ba8ab496c5823da807_1000k_1.mp4" type="video/mp4" /></video>
    </div>
}

export default Movie;
